INSERT INTO `gap` (`id`, `ATT_01`, `ATT_02`, `ATT_03`, `ATT_04`, `ATT_05`, `ATT_06`, `ATT_07`, `ATT_028`, `ATT_029`, `ATT_036`, `ATT_038`, `ATT_039`, `ATT_040`, `ATT_041`, `ATT_042`, `ATT_043`, `ATT_044`, `ATT_045`, `ATT_046`, `ATT_047`, `status`, `owner_of_the_object`, `last_time_updated`) VALUES
(1, 'غياب مركزية التوثيق ومركزية التنسيق', '', 'MIMGAP001', 'لا يوجد دور مركزي للبنية المؤسسية في توثيق التغيرات الحادثة في بنى الأعمال والتطبيقات والتقنية، مع غياب الدور التنسيقي بين الفرق والإدارات المختلفة.', '', 'TRUE', 'فجوة العنوان هي الحالة المستقبلية.', '', '', '', '', '', '1', 'admin', '2022-10-03', '17:06:00', ' ', ' ', ' ', 'Create', '1', 'admin', '2022-10-03 12:06:00'),
(2, 'عدم حوكمة البنية المؤسسية على القرارات والممارسات', '', 'MIMGAP002', 'ضعف البنية المؤسسية في قرارات التطوير والتغييرات التقنية، وغياب حوكمتها على الممارسات التقنية والتطويرية.', '', 'TRUE', 'فجوة العنوان هي الحالة المستقبلية.', '', '', '', '', '', '1', 'admin', '2022-10-03', '17:06:00', ' ', ' ', ' ', 'Create', '1', 'admin', '2022-10-03 12:06:00'),
(3, 'الاحتياج لرفع الوعي بأهمية البنية المؤسسية', '', 'MIMGAP003', 'ضعف الوعي بقيمة البنية المؤسسية ودورها في تحسين استغلال الموارد والمساعدة في اتخاذ القرارات الأفضل في البنى المختلفة للوزارة وتحسين الاستجابة للتغيرات السريعة.', '', 'TRUE', 'فجوة العنوان هي الحالة المستقبلية.', '', '', '', '', '', '1', 'admin', '2022-10-03', '17:06:00', ' ', ' ', ' ', 'Create', '1', 'admin', '2022-10-03 12:06:00'),
(4, 'ضغوط الأعمال اليومية هي المحرك الأكبر للتطوير بدلا عن الأهداف الاستراتيجية والرؤية الكلية المتناسقة', '', 'MIMGAP004', 'غياب الرؤية الكلية التي تهدف لتحقيق التناسق وخدمة الأهداف الاستراتيجية كمحرك رئيسي لقرارات التطوير، وزيادة مساحة ضغوط متطلبات الأعمال اليومية التي تصل من الإدارات المختلفة في التأثير على قرارات التغيير والتطوير.', '', 'TRUE', 'فجوة العنوان هي الحالة المستقبلية.', '', '', '', '', '', '1', 'admin', '2022-10-03', '17:06:00', ' ', ' ', ' ', 'Create', '1', 'admin', '2022-10-03 12:06:00'),
(5, 'غياب_ضعف الأتمتة عن كثير من الإجراءا', '', 'MIMGAP005', 'العدد الأقل من الإجراءات وخدمات الأعمال هو المؤتمت بشكل كامل، وهناك جزء كبير يتم بشكل يدوي كامل.', 'Business', 'TRUE', 'فجوة العنوان هي الحالة المستقبلية.', '', '', '', '', '', '1', 'admin', '2022-10-03', '17:06:00', ' ', ' ', ' ', 'Create', '1', 'admin', '2022-10-03 12:06:00'),
(6, 'ضعف التكامل والتناسق في رحلة العميل وتجربة المستخدم', '', 'MIMGAP006', 'لأسباب مختلفة، لا يوجد تناسق في تجربة المستخدم النهائية، ولا توجد معايير قياسية متبعة لتحسينها. أيضا هناك حاجة لإعادة تصميم رحلة العميل عبر الخدمات المختلفة لضمان التكامل والتناسق في تجربة العميل النهائية.', 'Business', 'TRUE', 'فجوة العنوان هي الحالة المستقبلية.', '', '', '', '', '', '1', 'admin', '2022-10-03', '17:06:00', ' ', ' ', ' ', 'Create', '1', 'admin', '2022-10-03 12:06:00'),
(7, 'توحيد قنوات التواصل مع العملاء وإيجاد تجربة تواصل ودعم متكاملة', '', 'MIMGAP007', 'توجد أكثر من قناة أو أداة للتواصل مع العملاء، وهو ما يؤثر على تناسق وتكامل عملية التواصل والدعم للعملاء. بالتالي؛ هناك حاجة لتوحيد تجربة التواصل والدعم عبر القنوات والأدوات والوحدات الإدارية المختلفة لخدمة المستثمر والعميل بشكل أفضل.', 'Business', 'TRUE', 'فجوة العنوان هي الحالة المستقبلية.', '', '', '', '', '', '1', 'admin', '2022-10-03', '17:06:00', ' ', ' ', ' ', 'Create', '1', 'admin', '2022-10-03 12:06:00'),
(8, 'حوكمة وإعادة ترتيب أولويات المبادرات والمشاريع للتوائم مع الاستراتيجية', '', 'MIMGAP008', 'توجد فجوات بين المبادرات والمشاريع وبين الرؤية والأهداف الاستراتيجية، بما يدعو لإعادة ترتيب أولوية المشاريع والمبادرات ليكون هناك توائم مع الاستراتيجية، وأيضا حوكمتها خلال التنفيذ لتحقيق نفس الهدف.', 'Business', 'TRUE', 'فجوة العنوان هي الحالة المستقبلية.', '', '', '', '', '', '1', 'admin', '2022-10-03', '17:06:00', ' ', ' ', ' ', 'Create', '1', 'admin', '2022-10-03 12:06:00'),
(9, 'ضعف توافر وجودة البيانات تؤثر على عملية اتخاذ القرار', '', 'MIMGAP009', 'لتشجيع عملية اتخاذ القرارات المبنية على البيانات، لا بد من علاج التحديات المتعلقة بالبيانات والتي تؤثر سلبا على هذا الهدف', 'Business', 'TRUE', 'فجوة العنوان هي الحالة المستقبلية.', '', '', '', '', '', '1', 'admin', '2022-10-03', '17:06:00', ' ', ' ', ' ', 'Create', '1', 'admin', '2022-10-03 12:06:00'),
(10, 'تكرار وتفرق البيانات بين الأنظمة', '', 'MIMGAP010', 'نتيجة لتعدد التطبيقات وغياب آليات الربط تتفرق.', 'Data', 'TRUE', 'فجوة العنوان هي الحالة المستقبلية.', '', '', '', '', '', '1', 'admin', '2022-10-03', '17:06:00', ' ', ' ', ' ', 'Create', '1', 'admin', '2022-10-03 12:06:00'),
(11, 'ضعف_غياب الربط بين الأنظمة ذات العلاقة', '', 'MIMGAP011', 'نتيجة لضعف التنسيق والحوكمة وغياب السياسات والنموذج المرجعي الموحد لعملية التطوير ومعايير الكفاءة والجودة.', 'Data', 'TRUE', 'فجوة العنوان هي الحالة المستقبلية.', '', '', '', '', '', '1', 'admin', '2022-10-03', '17:06:00', ' ', ' ', ' ', 'Create', '1', 'admin', '2022-10-03 12:06:00'),
(12, 'غياب معيارية أو أدوات موحدة للتكامل والربط بين الحلول المطورة', '', 'MIMGAP012', '', 'Data', 'TRUE', 'فجوة العنوان هي الحالة المستقبلية.', '', '', '', '', '', '1', 'admin', '2022-10-03', '17:06:00', ' ', ' ', ' ', 'Create', '1', 'admin', '2022-10-03 12:06:00'),
(13, 'غياب أدوات ذكاء الأعمال والتقارير والاحتياج لتطوير التقارير ولوحات المتابعة', '', 'MIMGAP013', 'يؤدي ذلك لزيادة الموارد البرمجية والتقنية المطلوبة وتأخر الخروج بحلول سريعة عند الحاجة لبناء تقارير أو متابعة مؤشرات أداء، مع ضعف على القدرة على استخلاص وجمع المعلومات ذات الطبيعة المعقدة من مصادر معلومات مختلفة.', 'Data', 'TRUE', 'فجوة العنوان هي الحالة المستقبلية.', '', '', '', '', '', '1', 'admin', '2022-10-03', '17:06:00', ' ', ' ', ' ', 'Create', '1', 'admin', '2022-10-03 12:06:00'),
(14, 'لا يوجد نموذج مرجعي لتصميم نماذج البيانات', '', 'MIMGAP014', '', 'Data', 'TRUE', 'فجوة العنوان هي الحالة المستقبلية.', '', '', '', '', '', '1', 'admin', '2022-10-03', '17:06:00', ' ', ' ', ' ', 'Create', '1', 'admin', '2022-10-03 12:06:00'),
(15, 'تعدد التطبيقات وتكرار الوظائف فما بينها', '', 'MIMGAP015', 'أكثر من 60 تطبيقا مختلفا بما يسبب صعوبة إدارة التطبيقات وصعوبة وصول المستخدم وتكرار الوظائف وزيادة استغلال موارد البنية التحتية وتفرق وتكرار البيانات وزيادة احتياجات التكامل والربط وزيادة الحاجة للموارد البرمجية.', 'Technology', 'TRUE', 'فجوة العنوان هي الحالة المستقبلية.', '', '', '', '', '', '1', 'admin', '2022-10-03', '17:06:00', ' ', ' ', ' ', 'Create', '1', 'admin', '2022-10-03 12:06:00'),
(16, 'تعدد التقنيات وضعف استغلال الموارد', '', 'MIMGAP016', 'استعمال أكثر من تقنية يؤدي لضعف استغلال الموارد البرمجية وموارد البنية التحتية المتاحة، حيث قد يتاح في وقت ما موارد للعمل غير قابلين للاستغلال لاختلاف التقنية المطلوبة في التطوير عن التقنية التي يعملون بها. كما أن عددا أقل من التقنيات يحسن من قيمة الاستثمار المعرفي عبر الفرق التقنية في الوزارة.', 'Technology', 'TRUE', 'فجوة العنوان هي الحالة المستقبلية.', '', '', '', '', '', '1', 'admin', '2022-10-03', '17:06:00', ' ', ' ', ' ', 'Create', '1', 'admin', '2022-10-03 12:06:00'),
(17, 'غياب الحلول البرمجية المعززة للإنتاجية والكفاءة', '', 'MIMGAP017', 'لا يوجد أنظمة BPM أو Low Code بحيث يمكن استعمالها في إنتاج حلول أسرع للأتمتة وذات خبرة مستخدم أكثر اتساقاً.', 'Technology', 'TRUE', 'فجوة العنوان هي الحالة المستقبلية.', '', '', '', '', '', '1', 'admin', '2022-10-03', '17:06:00', ' ', ' ', ' ', 'Create', '1', 'admin', '2022-10-03 12:06:00'),
(18, 'غياب النماذج المرجعية والسياسات الموحدة للتطوير وضعف التنسيق بين الفرق التطويرية', '', 'MIMGAP018', 'استعمال أكثر من تقنية يؤدي لضعف استغلال الموارد البرمجية المتاحة، حيث قد يتاح في وقت ما موارد للعمل غير قابلين للاستغلال لاختلاف التقنية المطلوبة في التطوير عن التقنية التي يعملون بها.', 'Technology', 'TRUE', 'فجوة العنوان هي الحالة المستقبلية.', '', '', '', '', '', '1', 'admin', '2022-10-03', '17:06:00', ' ', ' ', ' ', 'Create', '1', 'admin', '2022-10-03 12:06:00'),
(19, 'ضعف أدوات إدارة المستخدمين والصلاحيات والدخول الموحد والآمن', '', 'MIMGAP019', 'يوجد أكثر من نظام AD ولا يوجد نظام IAM لإدارة الدخول الآمن والوصول للأنظمة مركزيا.', 'Technology', 'TRUE', 'فجوة العنوان هي الحالة المستقبلية.', '', '', '', '', '', '1', 'admin', '2022-10-03', '17:06:00', ' ', ' ', ' ', 'Create', '1', 'admin', '2022-10-03 12:06:00'),
(20, 'غياب_نقص أدوار وظيفية هامة لضمان جودة الحلول وتحقيقها للأهداف', '', 'MIMGAP020', 'نقص في موارد هامة مثل محللي الأعمال ومالكي المنتجات والجودة وال Devops.', 'Technology', 'TRUE', 'فجوة العنوان هي الحالة المستقبلية.', '', '', '', '', '', '1', 'admin', '2022-10-03', '17:06:00', ' ', ' ', ' ', 'Create', '1', 'admin', '2022-10-03 12:06:00'),
(21, 'نقص في موارد البنية التحتية ووجود عوائق تشغيلية ببعض الخدمات الهامة', '', 'MIMGAP021', 'نقص في الخوادم وبعض تطبيقات وأجهزة التقنية الهامة ووجود بعض الإشكاليات التقنية خاصة بسحابة ديم.', 'Technology', 'TRUE', 'فجوة العنوان هي الحالة المستقبلية.', '', '', '', '', '', '1', 'admin', '2022-10-03', '17:06:00', ' ', ' ', ' ', 'Create', '1', 'admin', '2022-10-03 12:06:00'),
(22, 'وجود حلول لا تلبي متطلبات الأعمال ومعايير الجودة التقنية', '', 'MIMGAP022', 'وجود أنظمة قديمة مثل ال ERP أو وجود أنظمة تم تطويرها بما لا يتوافق مع متطلبات الأعمال بالشكل المطلوب.', 'Technology', 'TRUE', 'فجوة العنوان هي الحالة المستقبلية.', '', '', '', '', '', '1', 'admin', '2022-10-03', '17:06:00', ' ', ' ', ' ', 'Create', '1', 'admin', '2022-10-03 12:06:00');
